import './Women.css'
import Display from '../../Extras/Display';


function Women() {
   

  
  const Display = () => {
    return (   
        <div key={products.id} className="box">
        <img src={`${products.image }`} alt="" className="img" />
        <p>{products.title}</p>
        </div>
    )
  }
  
  return (
      <div>
        <h1>Category</h1>
        <div className="boxes"> 
          <Display />
          <Display />
          <Display />
          <Display />
          <Display />
          <Display />
          <Display />
          <Display />   
        </div>
      </div>
    )
  }

export default Women
